import React from "react";
import Typewriter from "typewriter-effect"
import "../Header/Header.css"
import  ImageHeader from "../asset/image_header.png"


const Header = () => {

    return (
        <>

            <div className="Header-text">
                <div className="Header-position">    
                  <img src={ImageHeader} alt="" />
                    <Typewriter
                        options={{
                            autoStart: true,
                            loop: true,
                            delay: 40,
                            strings: [
                                <span></span>,
                                "Hai bestie 😊",
                                `Selamat datang di Allforyougive🎁`,
                                "Selamat berbelanja Bestie🛍️"
                            ]
                        }}
                    />
                </div>
            </div>
        </>
    )
}



export default Header;
